import logo from './logo.svg';
import './App.css';



const App = () => {
  return (
    <div>
        <Header />
        <Technologies />
    </div>

  );
}


const Header = () => {
  return (
    <div className="head">
      <a>Home</a>
      <a>News Feed</a>
      <a>Messages</a>
    </div>
  );
}
const Technologies = () => {
  return (
    <div>
      <ul>
        <li>html</li>
        <li>css</li>
        <li>javascript</li>
        <li>React</li>
      </ul>
    </div>
  );
}

export default App;
